import React, { useState} from 'react';
import {Route, Switch} from 'react-router-dom';
import SearchAppBar from './components/header/appBar'
import Branch from './components/branch/index';
import Course from './components/course/index';
import CourseMode from './components/courseMode/index';
import CourseType from './components/courseType/index';
import DocumentType from './components/documentType/index';
import NotificationType from './components/notificationType/index';
import OccupationType from './components/occupationType/index';
import Pages from './components/pages/index';
import Sections from './components/sections/index';
import AdmissionStatus from './components/admissionStatus/index';
import Dashboard from './components/dashboard/Dashboard';
import Roles from './components/role/Index';
import Department from './components/department/index.js';
import EmployeeList from './components/employees/employeeList';
import CourseSpecification from './components/courseSpecification/index';
import VerticalTabs from './components/employees/employeeDeets/tabs';
import {useHistory, Redirect} from 'react-router-dom';
import Cookie from "js-cookie";
import Rules from './components/rules/tabs';
import adminActivity from './components/activity/adminActivity';
import AllSectionRules from './components/rules/sectionLevel/sections';
// import Loader from './components/auth/loader';
import Qualification from "./components/qualification/index";
import Relationship from "./components/relationship/index";
import CaseTransfer from "./components/caseTransfer/index";
import ResidenceType from "./components/residenceType/index";
import Loader from './components/auth/loader'
import CaseNoteType from './components/caseNoteType/index';
import Status from './components/status'
import Field from './components/field'

const jwt = require('jsonwebtoken');

export default function Layout() {
  let history = useHistory();
  let token = Cookie.get('token')
    if(token === ''){
      history.push('/');
    }


  const [query,setQuery] =useState([]); 
  const [results,setResults] =useState([]); 
  const [sugg,setSugg] = useState(false);
  const [pageIndex,setPageIndex] = useState(0)
    return (
      <div onClick={(event)=>{(event.target.className == 'links' || event.target.className =="MuiInputBase-input makeStyles-inputInput-114" ||event.target.className =="suggestion-list")?setSugg(true):setSugg(false) }}>
        <SearchAppBar  query={query} setQuery={setQuery} results = {results} setResults = {setResults} sugg={sugg} />
        <Switch>
          <Route path = "/dashboard"  component ={Dashboard} />
          <Route path = "/case-note-type"  component ={CaseNoteType} />
          <Route path = "/status"  component ={Status} />
          <Route path = "/fields"  component ={Field} />
          <Route path = "/roles" exact component = {Roles} />
          <Route path = "/departments" exact component = {Department} />
          <Route path = "/branches" exact component = {Branch} />
          <Route path = "/courses" exact component = {Course} />
          <Route path = "/course-modes" exact component = {CourseMode} />
          <Route path = "/course-types" exact component = {CourseType} />
          <Route path = "/document-types" exact component = {DocumentType} />
          <Route path = "/notification-types" exact component = {NotificationType} />
          <Route path = "/occupation-types" exact component = {OccupationType} />
          <Route path = "/course-specifications" exact component = {CourseSpecification} />
          <Route path = "/pages" exact component = {Pages} />
          <Route path = "/sections" exact component = {Sections} />
          <Route path = "/admission-status" exact component = {AdmissionStatus} />
          <Route path = "/employees" exact render= {()=><EmployeeList query={query} results={results}/>} />
          <Route path = "/employees/role/:id" exact render= {()=><EmployeeList query={query} results={results}/>} />
          <Route path = "/role/:id/employees" exact render= {()=><EmployeeList query={query} results={results}/>} />
          <Route path = "/employee/:id/" exact component = {VerticalTabs} />
          <Route path = "/role/:rid/employee/:id/" exact component = {VerticalTabs} />
          <Route path = "/rules" exact render = {()=><Rules tab={0}/>}  />
          <Route path = "/audits" exact component = {adminActivity} />
          <Route path = "/rules/sections/" exact render = {()=><Rules tab={1}/>} />
          <Route path = "/rules/sections/:page_key" exact render = {()=><Rules tab={1} subTab={pageIndex} setPageIndex={setPageIndex}/>} />
          <Route path = "/rules/pages" exact render = {()=><Rules tab={0}/>} />
          <Route path = "/rules/stages" exact render = {()=><Rules tab={2}/>} />
          <Route path = "/qualification-types" exact component = {Qualification}/>
          <Route path = '/relationships' exact component = {Relationship} />
          <Route path = '/residence-types' exact component = {ResidenceType} />
          <Route path = '/case-transfer' exact component = {CaseTransfer} />
          <Route path="*" render={() => (<Redirect to="/dashboard" />)} />
        </Switch>
      </div>
    );
  }
